window.bookSummaryJSON = "<p>From the creators of <i>Welcome to Night Vale</i>, <i>Alice Isn’t Dead</i>, and <i>Within The Wires</i> comes the return of <i>Unlicensed</i>, their critically acclaimed Audible Original.</p> <p>Out in the far reaches of Los Angeles County, where the glamor of Hollywood fades into the long empty of the desert, two unlicensed private detectives are about to face a case that is larger and more complicated then any they’ve faced before.</p> <p>A ghost-hunting influencer disappears in the middle of a live stream. A beekeeper is murdered after telling his friends that he has come across a dangerous secret.</p> <p>It is up to unlicensed PIs Lou Rosen and Molly Hatch to put together the pieces, as the powerful elite of California try to stop them. Even if they solve the case, can they come out the other side unscathed?</p> <p>From the dusty citrus groves of Redlands to the wealthy enclaves of Monterey, season two of <i>Unlicensed </i>is the kind of grand California noir they just don’t make anymore.</p>"; 
